import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import classes from "./EventDetail.module.css";
import { findEvent } from "../store/eventReducer";
import { useDispatch, useSelector } from "react-redux";

const EventDetail = () => {
  const params = useParams();
  const allData = useSelector((state) => state.dummyData.data);

  const data = allData.find((findedData) => findedData.id === params.eventId);

  return (
    <React.Fragment>
      <div className={classes.card}>
        <h2>
          {data.length !== 0 && data.title} ({data.length !== 0 && data.date})
        </h2>
        <img src={data.length !== 0 && data.url} alt="meteor" />
        <p>{data.length !== 0 && data.description}</p>
      </div>
    </React.Fragment>
  );
};

export default EventDetail;

